import React from "react";

export default function Time(props) {
  const timeMessage = new Date(props.data.createdAt).toLocaleDateString();
  if (timeNow !== timeMessage) {
    timeNow = timeMessage;
    console.log(
      new Date().toLocaleDateString(),
      new Date(props.data.createdAt).toLocaleDateString()
    );
  }
  return(
    <div className="flex flex-horCntr pad-t_30px">
      <div className="flex flex-centered date-block">
        <h3>Data</h3>
      </div>
    </div>
  );
}
